import {GET_VILLA} from "../action/type";

export const villaReducer = (villa1 = {}, action) => {
    switch (action.type){
        case GET_VILLA:
            return {villa: action.payload.content,
                total: action.payload.totalPages};
        default:
            return villa1;
    }
}
